import 'package:library_reservation/core/model/token_entity.dart';tokenEntityFromJson(TokenEntity data, Map<String, dynamic> json) {	if (json['accessToken'] != null) {		data.accessToken = json['accessToken'].toString();	}	if (json['expiresIn'] != null) {		data.expiresIn = json['expiresIn'] is String				? int.tryParse(json['expiresIn'])				: json['expiresIn'].toInt();	}	return data;}Map<String, dynamic> tokenEntityToJson(TokenEntity entity) {	final Map<String, dynamic> data = new Map<String, dynamic>();	data['accessToken'] = entity.accessToken;	data['expiresIn'] = entity.expiresIn;	return data;}